import React from 'react';
import { Clock, CheckCircle, XCircle, AlertCircle, Eye, Activity, Play } from 'lucide-react';

const TaskCard = ({ task, onViewDetails, onViewLiveExecution }) => {
  const getStatusIcon = (status) => {
    switch (status) {
      case 'completed':
        return <CheckCircle className="w-5 h-5 text-success-500" />;
      case 'running':
        return <Activity className="w-5 h-5 text-warning-500 animate-pulse" />;
      case 'failed':
        return <XCircle className="w-5 h-5 text-error-500" />;
      case 'created':
        return <AlertCircle className="w-5 h-5 text-primary-500" />;
      default:
        return <Clock className="w-5 h-5 text-gray-400" />;
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'completed':
        return 'bg-success-50 text-success-700 border-success-200';
      case 'running':
        return 'bg-warning-50 text-warning-700 border-warning-200';
      case 'failed':
        return 'bg-error-50 text-error-700 border-error-200';
      case 'created':
        return 'bg-primary-50 text-primary-700 border-primary-200';
      default:
        return 'bg-gray-50 text-gray-700 border-gray-200';
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleString();
  };

  const getExecutionTime = () => {
    if (!task.completed_at) return null;
    const start = new Date(task.created_at);
    const end = new Date(task.completed_at);
    const diff = Math.round((end - start) / 1000);
    return `${diff}s`;
  };

  const getCurrentAgent = () => {
    if (!task.current_agent) return null;
    return task.current_agent.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase());
  };

  const getCurrentStep = () => {
    if (!task.current_step) return null;
    return task.current_step.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase());
  };

  return (
    <div className="bg-white rounded-lg border border-gray-200 p-4 hover:shadow-md transition-shadow">
      <div className="flex items-start justify-between mb-3">
        <div className="flex items-center space-x-2">
          {getStatusIcon(task.status)}
          <div className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium border ${getStatusColor(task.status)}`}>
            {task.status.charAt(0).toUpperCase() + task.status.slice(1)}
          </div>
        </div>

        <div className="flex items-center space-x-1">
          {task.status === 'running' && (
            <button
              onClick={() => onViewLiveExecution(task)}
              className="p-1 text-warning-500 hover:text-warning-700 transition-colors"
              title="View live execution"
            >
              <Play className="w-4 h-4" />
            </button>
          )}
          <button
            onClick={() => onViewDetails(task)}
            className="p-1 text-gray-400 hover:text-gray-600 transition-colors"
            title="View details"
          >
            <Eye className="w-4 h-4" />
          </button>
        </div>
      </div>

      <div className="mb-3">
        <p className="text-sm text-gray-600 font-mono bg-gray-50 px-2 py-1 rounded">
          ID: {task.task_id.slice(0, 8)}...
        </p>
      </div>

      {/* Progress Bar for Running Tasks */}
      {task.status === 'running' && task.progress !== undefined && (
        <div className="mb-3">
          <div className="flex items-center justify-between mb-1">
            <span className="text-xs font-medium text-gray-700">Progress</span>
            <span className="text-xs text-gray-500">{task.progress}%</span>
          </div>
          <div className="w-full bg-gray-200 rounded-full h-2">
            <div 
              className="bg-warning-500 h-2 rounded-full transition-all duration-300"
              style={{ width: `${task.progress}%` }}
            ></div>
          </div>
        </div>
      )}

      {/* Current Activity for Running Tasks */}
      {task.status === 'running' && (getCurrentAgent() || getCurrentStep()) && (
        <div className="mb-3 p-2 bg-warning-50 rounded border border-warning-200">
          <p className="text-xs text-warning-700 font-medium mb-1">Current Activity:</p>
          {getCurrentAgent() && (
            <p className="text-xs text-warning-600">
              <span className="font-medium">Agent:</span> {getCurrentAgent()}
            </p>
          )}
          {getCurrentStep() && (
            <p className="text-xs text-warning-600">
              <span className="font-medium">Step:</span> {getCurrentStep()}
            </p>
          )}
        </div>
      )}

      <div className="space-y-2 text-sm text-gray-600">
        <div>
          <span className="font-medium">Created:</span> {formatDate(task.created_at)}
        </div>

        {task.completed_at && (
          <div>
            <span className="font-medium">Completed:</span> {formatDate(task.completed_at)}
            {getExecutionTime() && (
              <span className="ml-2 text-xs bg-gray-100 px-2 py-0.5 rounded">
                {getExecutionTime()}
              </span>
            )}
          </div>
        )}

        {task.result && task.status === 'completed' && (
          <div className="mt-3 p-2 bg-success-50 rounded border border-success-200">
            <p className="text-xs text-success-700 font-medium mb-1">Result Preview:</p>
            <p className="text-xs text-success-600 line-clamp-2">
              {task.result.length > 100 ? `${task.result.slice(0, 100)}...` : task.result}
            </p>
          </div>
        )}

        {task.result && task.status === 'failed' && (
          <div className="mt-3 p-2 bg-error-50 rounded border border-error-200">
            <p className="text-xs text-error-700 font-medium mb-1">Error:</p>
            <p className="text-xs text-error-600 line-clamp-2">
              {task.result.length > 100 ? `${task.result.slice(0, 100)}...` : task.result}
            </p>
          </div>
        )}

        {/* Recent Execution Logs Preview */}
        {task.execution_log && task.execution_log.length > 0 && (
          <div className="mt-3 p-2 bg-gray-50 rounded border border-gray-200">
            <p className="text-xs text-gray-700 font-medium mb-1">
              Recent Activity ({task.execution_log.length} logs):
            </p>
            <div className="space-y-1">
              {task.execution_log.slice(-2).map((log, index) => (
                <div key={index} className="text-xs text-gray-600">
                  <span className="font-medium">
                    {log.agent.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase())}:
                  </span>
                  <span className="ml-1">
                    {log.message.length > 50 ? `${log.message.slice(0, 50)}...` : log.message}
                  </span>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default TaskCard;
